import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './pages/Home/Home';
import { Context, ProductReducer } from './storage/Context';
function App() {

    const [productAmount, setProductAmount] = useState({});
    

    return (
        <>
            <Context.Provider value={productAmount, ProductReducer}>
                <BrowserRouter>
                    <Routes>
                        <Route path={'/'} element={<Home/>} />
                    </Routes>
                </BrowserRouter>
            </Context.Provider>
        </>
    );
}

export default App;
